import React from 'react';

import styles from './Style/Main.module.css';

// Components
import Servers from './Components/Servers';
import Channels from './Components/Channels';
import Content from './Components/Content';

let Main = () => {
  return (
    <div className={styles.Container}>
      <Servers />
      <Channels />
      <Content />
    </div>
  );
}
type MyProps = { Name: string, id: number, Active: number };
type MyState = { Picture: string };
class Server extends React.Component<MyProps, MyState> {
  public state: MyState;
  constructor(props) {
    super(props);
    this.state = {
      Picture: `${process.env.Storage_Url}/Servers/UUw40MdRDcUxdEy00Zuo/Icon`
    };
  }
  render() {
    return (
      <div 
        role="button"
        className={styles.Container}
        onClick={
          (evt => this.props.customClickEvent(evt, this.props.id))
        }
      >
        {
          this.props.Active == this.props.id && <div className={styles.Active}></div>
        }
        <picture className={styles.Icon}>
          <img className={styles.Icon_IMG} src={this.state.Picture} />
        </picture>
      </div>
    );
  }
}

export default Main;
